MINE_MAP_ZONE_GUID = 'b0e900'

function onLoad()
  mineMapZone = getObjectFromGUID(MINE_MAP_ZONE_GUID)
end

function pullNewMap()
  self.shuffle()
  self.takeObject({
    position          = mineMapZone.getPosition(),
    rotation          = {0, 90, 0}
  })
end

GRANDPA_GOAL_DECK_GUID = '2d0a28'
FISH_BAG_GUID = 'a124a6'
MINE_MAP_DECK_GUID = 'a20cfa'
BUNDLES_ZONE_GUID = 'e89303'
FARM_ZONE_GUID = 'e36eb9'
SEASON_DECK_ZONE_GUID = '9b7525'
FORAGEABLES_ZONE_GUID = '161b00'
MINE_LEVEL_ZONE_GUID = '3789a9'
MONEY_ZONE_GUID = 'abd7f2'
ALL_OTHER_DECK_GUIDS = {'1d254b', '4e3162', 'c5a1a1', '62f3f0', 'baefc4', '6e5ac9', 'ce2e15', 'c0b768', '710dc9'}

function onLoad()
  gameStarted = false

  grandpaGoalDeck = getObjectFromGUID(GRANDPA_GOAL_DECK_GUID)
  fishBag = getObjectFromGUID(FISH_BAG_GUID)
  mineMapDeck = getObjectFromGUID(MINE_MAP_DECK_GUID)
  bundlesZone = getObjectFromGUID(BUNDLES_ZONE_GUID)
  farmZone = getObjectFromGUID(FARM_ZONE_GUID)
  seasonDeckZone = getObjectFromGUID(SEASON_DECK_ZONE_GUID)
  forageablesZone = getObjectFromGUID(FORAGEABLES_ZONE_GUID)
  mineLevelZone = getObjectFromGUID(MINE_LEVEL_ZONE_GUID)
  moneyBowl = getObjectFromGUID(MONEY_ZONE_GUID)

  decks = {grandpaGoalDeck, mineMapDeck}
  for _, guid in ipairs(ALL_OTHER_DECK_GUIDS) do
    local deck = getObjectFromGUID(guid)
    table.insert(decks, deck)
  end

  self.createButton({
    label="Setup Standard Year Game", click_function="setupStandardGame",
    function_owner=self, position={0,0,1.5}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={210/255,195/255,150/255}
  })
  self.createButton({
    label="Setup Randomized Year Game", click_function="setupRandomGame",
    function_owner=self, position={0,0,3}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={210/255,195/255,150/255}
  })
  self.createButton({
    label="Fill Fish Track", click_function="updateTracker",
    function_owner=fishBag, position={0,0,4.5}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={115/255,140/255,195/255}
  })
  self.createButton({
    label="Fish Move (Daily Event)", click_function="fishMigrate",
    function_owner=fishBag, position={0,0,6}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={115/255,140/255,195/255}
  })

  self.createButton({
    label="Setup Next Season", click_function="setupNextSeason",
    function_owner=forageablesZone, position={0,0,7.5}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={105/255,175/255,110/255}
  })
  self.createButton({
    label="Water Crops", click_function="waterAllCrops",
    function_owner=farmZone, position={0,0,9}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={65/255,205/255,220/255}
  })
  self.createButton({
    label="Descend in the Mine", click_function="nextLevel",
    function_owner=mineLevelZone, position={0,0,10.5}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={110/255,105/255,95/255}
  })

--[[
  self.createButton({
    label="Update Coin Bowl", click_function="updateCoinBowl",
    function_owner=moneyBowl, position={0,0,12}, scale={1,1,1},
    height=500, width=3500, font_size=250, color={215/255,210/255,55/255}
  })
]]
end

function setupStandardGame()
  setupGame(true)
end

function setupRandomGame()
  setupGame(false)
end

function shuffleDecks()
  for _, deck in ipairs(decks) do
    deck.shuffle()
  end
end

function setupGame(standard)
  if gameStarted == false then
    gameStarted = true
    shuffleDecks()
    farmZone.call('getStartingParsnip')
    Wait.time(function() forageablesZone.call('setupNextSeason') end, .25)
    Wait.time(function() fishBag.call('updateTracker') end, .5)
    Wait.time(function() mineMapDeck.call('pullNewMap') end, .75)
    Wait.time(function() seasonDeckZone.call('setupYear', {std = standard}) end, 1)
    Wait.time(function() bundlesZone.call('fillCommCenter') end, 1.25)
    Wait.time(function() grandpaGoalDeck.call('generateGrandpaGoals') end, 1.5)
    Wait.time(function() farmZone.call('randomizeBuildOptions') end, 1.75)
    Wait.time(function() moneyBowl.call('startingCoins') end, 2)
  end
end

GRANDPA_GOAL_ZONE_GUIDS = {'e97c1f', '6f193d', '331e24', 'e425d0'}

function onLoad()
  grandpaGoalZones = {}
  for _, guid in ipairs(GRANDPA_GOAL_ZONE_GUIDS) do
    local zone = getObjectFromGUID(guid)
    table.insert(grandpaGoalZones, zone)
  end
end

function generateGrandpaGoals()
  for x, zone in ipairs(grandpaGoalZones) do
    Wait.time(function()
      self.takeObject({
        position          = zone.getPosition(),
        rotation          = {0, 180, 0}
      })
    end, .25*x)
  end
end
